INSERT INTO `comments` VALUES (1,'address\r\n0801119',1,1,'2018-11-28 10:14:58','2018-11-28 10:14:58'),(2,'test',1,2,'2018-11-28 10:32:30','2018-11-28 10:32:30'),(3,'1-	Deposit money only from the registered accounts in your KYS section.\r\n2-	After deposit go to your INR deposit wallet and fill up the transaction number and amount in order to get funds in your INR wallet.\r\n3-	Do not fill false information it can terminate your account.\r\n4-	NEFT takes time to get credited in our P2P Partners account use IMPS or RTGS in order to get fast wallet funds.\r\n5-	All the transactions are backed by our terms https://www.tradexic.io/terms \r\n\r\n1-	All card transactions are backed by 7 days no withdrawal policy.\r\n\r\nBank Name: ICICI Bank\r\nAccount Number: 167105001053\r\nIFSC Code: ICIC0001617\r\nAccount Holder Name: GAURABHI MAULTISOLUTIONS',1,3,'2018-12-05 06:09:03','2018-12-05 06:09:03'),(4,'1-	Deposit money only from the registered accounts in your KYS section.\r\n2-	After deposit go to your INR deposit wallet and fill up the transaction number and amount in order to get funds in your INR wallet.\r\n3-	Do not fill false information it can terminate your account.\r\n4-	NEFT takes time to get credited in our P2P Partners account use IMPS or RTGS in order to get fast wallet funds.\r\n5-	All the transactions are backed by our terms https://www.tradexic.io/terms \r\n\r\n1-	All card transactions are backed by 7 days no withdrawal policy. </br>\r\n\r\nBank Name: ICICI Bank\r\nAccount Number: 167105001053\r\nIFSC Code: ICIC0001617\r\nAccount Holder Name: GAURABHI MAULTISOLUTIONS',1,3,'2018-12-05 06:12:07','2018-12-05 06:12:07'),(5,'<a href=\"http://www.tradexic.io\">Home</a>',1,3,'2018-12-26 00:18:28','2018-12-26 00:18:28'),(6,'Just testing.',1,7,'2019-01-03 02:23:05','2019-01-03 02:23:05'),(7,'KYC  VERIFIED',1,6,'2019-01-05 12:43:30','2019-01-05 12:43:30'),(8,'I CANT BUY BTC STILL WHY',45,6,'2019-01-06 07:05:13','2019-01-06 07:05:13'),(9,'Hi, Your Bank account is not update for INR deposit & withdrawal you need your KYC & Bank account both updated.\r\nYou can only  deposit, withdrawal and trade crypto coins without KYC and Bank information.\r\nHave  great day ,\r\n\r\nRegards\r\nTradexic Support ',1,8,'2019-01-06 07:47:35','2019-01-06 07:47:35'),(10,'Bank Name: ICICI Bank\r\nAccount Number: 167105001053\r\nIFSC Code: ICIC0001617\r\nAccount Holder Name: GAURABHI MAULTISOLUTIONS\r\n\r\nBank, Debit Card & UPI deposit and withdrawal Policy:\r\n\r\n1. Deposit money only from the registered accounts in your KYC section.\r\n\r\n2. After deposit go to your Fiat Currency deposit wallet and fill up the transaction number and amount in order to get funds in your Fiat Currency wallet.\r\n\r\n3. NEFT & SWIFT transactions takes long time to get credited in our P2P Partners account, use IMPS or RTGS in order to get fast wallet funds.\r\n\r\n4. Filling up false information, can terminate your Tradexic.io account.\r\n\r\n5. All debit credit card transactions are backed by 7 days no withdrawal policy.\r\n\r\n6. All the transactions are backed by our terms.\r\n\r\nNote: Avoid any request claiming company person or partner asking for money or account information by email, sms or call, we only send and receive requests by our platforms in built support ticket system, we only take responsibility of our support system requests.',1,9,'2019-01-08 11:17:09','2019-01-08 11:17:09');
/*!40000 ALTER TABLE `comments` ENABLE KEYS */;
