INSERT INTO `static_pages` VALUES (1,'About US','about-us','About US','About Tradexic, about btc exchange, About bitcoin exchange, about crypto exchange  ','Tradexic Exchange is a market leader in Crypto currency landscape. We provide the simplest and trusted platform to trade, Exchange, store, and accept crypto currencies like Bitcoin, Ethereum, Litecoin, Bitcoin Cash etc.','<p align=\"center\" style=\"text-align:center; margin:0in 0in 8pt\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/4/content_trade.png\" style=\"width: 206px; height: 206px;\" /></p>\r\n\r\n<p align=\"center\" style=\"text-align:center; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">A Revolutionary New Trading Platform and Exchange</span></span></b></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"text-align:center; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tradexic is a secure cryptocurrency exchange and trading platform that offers an extensive range of features and a multitude of great opportunities for both beginner traders and experienced crypto traders. &nbsp;</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Wallets</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;Users can rely on TRADEXIC&#39;S Multi-Sig wallet and security structure.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;With TRADEXIC you can feel safe as we keep 100% of funds offline in a secure cold wallets.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\">&nbsp;</span><span style=\"font-family:&quot;Times New Roman&quot;,serif\">All withdrawals are protected by 2fa (google, otp) and mobile call confirmation.</span></span></span></span></span></p>\r\n\r\n<p align=\"right\" style=\"text-align:right; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Analytics</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;By viewing a detailed history of your trades, you can track both weaknesses and strengths in your trading strategy.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;You no longer have to painstakingly record this data yourself, Tradexic&nbsp;will do it for you. With more indicators, you can develop your unique and profitable strategy for trading crypto-currencies.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;Unique professional user analytics and graphics to optimize your trading experience and help you to choose which experienced trader you&rsquo;d like to follow.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Security</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> Tradexic partnered with some of the legal registered and licensed companies for global fiat transaction.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> To protect our customers from hacks we provide confirmation by email/sms&nbsp;as well as 2 factor authentication.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> To avoid fraudulent, suspicious login attempts, you can go directly to your settings and view all login information to ensure that all the login attempts done by you only.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span><span style=\"font-family:&quot;Times New Roman&quot;,serif\">All withdrawals are protected by 2fa (google, otp) and in case of any suspicious withdrawal, we have a call confirmation methodology in order to protect your funds.</span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Future developments</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> </span></span></span></span></span>&nbsp;User referral link for profit sharing (on achievement of 5000 users)</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> </span></span></span></span></span>&nbsp;API for easy integration for all platforms and bots. API documentation available upon request. (on achievement of1M USD daily trading volume)</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></span></span></span></span>Automatically copy positions opened and managed by a selected expert traders. Experienced crypto-traders benefit by earning a percentage of their copied&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\"></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"> Tradexic</span></span></span></span></span>&nbsp;community where our users can share their thoughts and trading ideas. Members who have a high interaction rate, reach and followers will have reduced fee&rsquo;s on Tradexic Exchange.&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\">&nbsp;</span></span></span></span></span>Mobile/Desktop app to trade anywhere with ease. You can access our exchange and all of its features from any smart phone/desktop or tablet.&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\">&nbsp;</span></span></span></span></span>The addition of new order types such as &ldquo;fill or kill&rdquo; and &ldquo;trailing stop&rdquo; to get the best out of your trades.&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\">&nbsp;</span></span></span></span></span>Margin Trading This allows users to borrow money against their current funds to trade cryptocurrency &ldquo;on margin&rdquo; on Ethbits Exchange.&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Segoe UI Symbol&quot;,sans-serif\">&nbsp;</span></span></span></span></span>Broker operation, with our platform anyone can start broking business at no cost, our platform will give users a option to add new users under there broker id which will share upto 80% of brokerage with broker users.&nbsp;(on achievement of1M USD daily trading volume)</p>\r\n\r\n<div class=\"clearfix\" style=\"text-align: center;\">&nbsp;</div>\r\n',1,'2018-04-28 05:18:51','2018-12-04 11:56:22'),(2,'Terms','terms','Terms','tradexic TERMS, tradexic exchange terms, Terms of Service, bitcoin exchange TERMS ','TRADEXIC (the Platform) is a virtual platform that provides one-stop-solution Services enabling storage, transfer, obtaining, exchanging and trading Crypto and Fiat currencies. If you wish to register, and convey transactions on the Platform, please read, understand and accept these Terms and Conditions (the Terms).','<script src=\"https://wchat.freshchat.com/js/widget.js\"></script>\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC (the Platform) is a virtual platform that provides one-stop-solution Services enabling storage, transfer, obtaining, exchanging and trading Crypto and Fiat currencies. If you wish to register, and convey transactions on the Platform, please read, understand and accept these Terms and Conditions (the Terms).</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">Any use and/or access of this Website would expressly mea