c.).</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">1.1.9. E-Money, The Fiat Currency stored and deposited in the Wallets and transferred from the User&#39;s Financial Bank Account to the User&#39;s Wallet</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">1.1.10. Financial Bank Account, Account of which the User is the beneficial owner, from which the User (i) may load Funds into his/her Wallet and (ii) to which he/she may transfer Funds from his/her Wallet.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">1.1.11. Fiat Currency, a government-issued currency designated as a legal tender in its country of issuance through a government decree, regulation, or law.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">1.1.12. Funds, Crypto or Fiat currency.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom