sans-serif\"><span style=\"color:#535762\">3.2.1. On receipt of instructions to purchase Cryptocurrency using E-Money by the Platform, the User will be unable to withdraw the consent to that purchase unless the purchase is not due to occur until an agreed period in time not being immediate.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">3.3. Transferring E-money from the User Account: The User may transfer all or part of any E-Money held in the User&#39;s Wallet at any time. Unless agreed otherwise, funds will be transferred to the designated Financial Bank Account you have registered with us. The Company may perform due diligence, before pushing out the E-money into the designated Financial Bank Account. E-money shall also be transferred to the designated Financial Bank Account in case of termination of this Agreement. The Amount transferred to the designated Financial Bank Account shall always be the amount requested less any fees charged by the Platform and/ or the Company for such transaction.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">3.4. Presumption of Authorization: Where any Transaction is undertaken on the Platform, irrespective of it involving E-money, using the User&#39;s credentials, it shall always be assumed that it was the User who authorized the Transaction(s).</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><spa