sp;The Company shall endeavor to expeditiously redress the same, but within reasonable time as may be provided in applicable laws.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:7.5pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><a name=\"_sbti646x55e7\"></a><b><span style=\"font-size:18.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">38. Risk Disclosure</span></span></span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Trading and financing trades in Digital Tokens entails certain risks. This risk disclosure statement cannot and does not disclose all risks and other aspects involved in holding, trading, or engaging in financing or financed transactions in Digital Tokens. Risks include, but are not limited to, the following:</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>1. Market Risk: </strong>The market for Digital Tokens is still new and uncertain. No-one should have funds invested in Digital Tokens or speculate in Digital Tokens that she is not prepared to lose entirely. Whether the market for one or more Digital Tokens will move up or down, or whether a particular Digital Token will lose all or substantially all of its value, is unknown. This applies both to traders that are going long and to traders that are shorting the market. Participants should be cautious about holding Digital Tokens.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>2. Liquidity and Listing Risk:</strong> Markets for Digital Tokens have varying degrees of liquidity. Some are quite liquid while others may be thinner. Thin markets can amplify volatility. There is never a guarantee that there will be an active market for one to sell, buy, or trade Digital Tokens or products derived from or ancillary to them. Furthermore, any market for tokens may abruptly appear and vanish. Tradexic makes no representations or warranties about whether a Digital Token that may be traded on the Site may be traded on the Site any point in the future, if at all. Any Digital Token is subject to delisting without notice or consent.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>3. Legal Risk: </strong>The legal status of certain Digital Tokens may be uncertain. This can mean that the legality of holding or trading them is not always clear. Whether and how one or more Digital Tokens constitute property, or assets, or rights of any kind may also seem unclear. Participants are responsible for knowing and understanding how Digital Tokens will be addressed, regulated, and taxed under applicable law.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>4. Exchange Risk (Counterparty Risk):</strong> Having Digital Tokens on deposit or with any third party in a custodial relationship has attendant risks. These risks include security breaches, risk of contractual breach, and risk of loss. Participants should be wary of allowing third parties to hold their property for any reason.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>5. Trading Risk:</strong> In addition to liquidity risks, values in any digital token marketplace are volatile and can shift quickly. Participants in any Digital Tokens market are warned that they should pay close attention to their position and holdings, and how they may be impacted by sudden and adverse shifts in trading and other market activities.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>6. Risks Associated with Financing Activities:</strong> When you finance a purchase or sale of Digital Tokens on a peer-to-peer basis, you run the risk of losing your provided financing. Similarly, when you accept financing to enter a trading agreement, you accept the risk of not being able to repay that financing (e.g., if the market price of the Digital Token you purchased with the financing falls). Participants should know all of the terms of any contracts they enter and how their trading strategies and other market and risk factors can affect their financing obligations.</span></span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><a name=\"_sbti646x55e7\"></a><b><span style=\"font-size:18.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">39.Cancellation/Refund Policy</span></span></span></span></b></span></span></span></h2>\r\n\r\n<p style=\"margin-bottom:12.0pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Tradexic.io, under no circumstance, entertains the refund or cancellation of a successfully&nbsp;fulfilled order. Once a buyer order is fully or partially matched, the amount in Fiat Currency is transferred to&nbsp;the seller(s) and these transactions cannot be reversed.<br />\r\nTradexic.io shall be entitled to retain/deduct the amounts due to it from the user and transfer or&nbsp;refund the balance lying in the User Account, except when it is unable to do so in compliance&nbsp;with applicable laws. Transfers shall be to any other cryptocurrency wallet specified by User and&nbsp;refund shall be in Fiat Currency.</span></span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin: 0in 0in 8pt;\"><span style=\"font-size:11pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:Calibri,sans-serif\"><a name=\"_sbti646x55e7\"></a><b><span style=\"font-size:18.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">40. Bank &amp; Card deposit and withdrawal Policy</span></span></span></span></b></span></span></span></h2>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>1. </strong>Deposit money only from the registered accounts in your KYC section.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\"><strong>2.&nbsp;</strong>After deposit go to your Fiat Currency deposit wallet and fill up the transaction number and amount in order to get funds in your Fiat Currency wallet.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a62