eive account realated requests by our platforms in built support ticket system.</span></strong></p>',1,'2018-04-28 05:28:15','2019-01-06 08:03:46'),(3,'Privacy','privacy','Privacy','Privacy','tradexic.io may collect, use, and disclose users personal data in cases in which it is required or authorized by applicable laws. tradexic.io collects, uses, and may disclose personal data for business purposes deemed reasonable with regard to the consent expressed by the user, having notified him/her duly in the following disclaimer:','<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><strong>tradexic.io may collect, use, and disclose users&rsquo; personal data in cases in which it is required or authorized by applicable laws. tradexic.io collects, uses, and may disclose personal data for business purposes deemed reasonable with regard to the consent expressed by the user, having notified him/her duly in the following disclaimer:</strong></p>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">The purpose of this Privacy Policy is to make aware the User and any person who access this website of how Tradexic.io (The company) and tradexic.io (The Platform), hereinafter collectively referred to as &quot;TRADEXIC&quot; collects, uses and discloses, shares, stores and protects personal data and information collected by or provided to TRADEXIC whenever any of the services provided by TRADEXIC are accessed or used including third party applications.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><sp