n from third parties such as credit bureaus etc. On using the Services provided, TRADEXIC collects information about the User&#39;s transactions and/ or other activities on the Website and continuously collects the information about your computer, mobile device or other access devices of similar kind. TRADEXIC also collects all Data submitted by the User on the Website through the Registration Form(s), Contact Us Form, email correspondence or Data which may be provided to our authorized third parties and Support teams. If the User contacts TRADEXIC or is contacted by TRADEXIC using telephone, TRADEXIC may monitor or record the phone call for quality assurance, training and security purposes. It is assumed that the User is of a legal age (at least 18 years of age), TRADEXIC does not intentionally collect Data of any individual below the legal age.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Consent to Data Collection</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">By accessing the Website or using any of the Services provided, The User hereby acknowledges having read and understood this Data Privacy Policy and consents to the collection and use of Data as per this Policy read with the Website Usage Agreement. In case the User submits Data on behalf of