cted in order to understand and improve User&#39;s online experience, mitigate risk and enhance security, recognize the User as a TRADEXIC Account holder and to determine what promotions and services the User prefers or are likely to be of interest to the User. The User may also get Cookies from our advertisers. We do not control these cookies, and once the User has clicked on the advertisement and left our Website, our Privacy Policy no longer applies. By registering an account with TRADEXIC, or continuing to use the website, the User agrees to the use of Cookies as set out in this policy. The User may decline and reject the Cookies if the Browser permits but doing so may interfere with the use of TRADEXIC features and services.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Use of Data Collected</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC may use the Data collected for the following purposes:</span></span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&