the bottom of an email you have previously received from TRADEXIC.io. You may also unsubscribe by getting in touch with the Data Protection Office appointed under this Policy. Please note that your request may take up to 28 days to be processed. TRADEXIC shall not use the Data for any other purpose except as stated above. The User shall be at liberty to withdraw his/ her consent on such use of Data as he/she deems fit. Please note, in the event consent to use Data is withdrawn, it may lead to restricted, limited or no access to certain features or services provided by TRADEXIC.</span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Disclosure of Data Collected</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC will disclose to and share User&#39;s Data only with the following third parties and in the following events:</span></span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">With TRADEXIC affiliates, business and financial partners.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">With intermediaries or subcontractors hired by TRADEXIC including but not limited to third party identity verification service providers, service providers managing the Operations of TRADEXIC such as invoice and fee collection, technology providers and to provide information that according to TRADEXIC may be of relevance to the User.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">With any other Third Party to meet the purpose for which the information was originally submitted to TRADEXIC by the User.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">When TRADEXIC, in reasonable suspicion, believes such disclosure to prevent / investigate financial loss or crimes, physical harm or performance of unlawful activities.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">When it is required any law, rules, regulations or by a Court Order, with the Law Enforcement Authorities, including Government Officials.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">With any other entity, with whom TRADEXIC has merged with, acquired or has been acquired. The User, in such an event, shall receive prior notice of the same and change, if any, in this Privacy Policy.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">With Other TRADEXIC Account holders/ Users in order to complete, perform, cancel, restrict or reverse a Transaction and perform any other activities in relation to a Transaction request by the User.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"color:#535762\"><span style=\"line-height:18.0pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Any other person notified by the User.</span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">Third parties engaged by TRADEXIC to whom Data has been disclosed shall be governed by this Privacy Policy.</span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Data Protection and Security</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC respects the User&#39;s privacy and recognizes the need to protect the Data shared with it. TRADEXIC implements the generally accepted security standards to protect the Data obtained by it. Special security measures are undertaken by TRADEXIC to prevent unauthorised access, collection, copying, use, modification, disposal or disclosure of Data and the associated risks. Some of the measures undertaken include firewalls and data encryption software. Physical access to the Offices is also regulated and only authorized employees can access User&#39;s Data strictly following all the necessary security requirements. TRADEXIC will continue to enhance its security procedures as new technology becomes available.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Retention of Data</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC continuously stores User Data and retains the Data to comply with its legal and business obligations. In case the purpose for which Data was collected is no longer being served, TRADEXIC shall cease to collect, use or disclose Data. TRADEXIC shall retain record of the User&#39;s Data for a minimum period of five years from the date the User ceases operations and deletes his/her TRADEXIC Account. This retention of Data is in consonance with the PDPA and deemed necessary by TRADEXIC to resolve legal disputes, if any.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Access to Personal Data</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">The User can gain access to the Data provided by him/ her upon request. It shall be the sole prerogative of TRADEXIC to demand a written request for access. TRADEXIC shall be at liberty to verify the User&#39;s identity before acting on such requests. A request for access is governed by PDPA and as such can be provided to correct errors and omissions in the User&#39;s Personal Data with a view to provide accurate, complete and true information to TRADEXIC. Please note, that these access requests may be charged.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Withdrawal of Consent</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">The User shall be at liberty to withdraw his/ her consent with regard to collection, use or disclosure of Data. In case the User wishes to withdraw such consent, preliminary steps should be taken to notify TRADEXIC about the decision to withdraw consent. TRADEXIC shall inform the User about the potential consequences of proceeding with such an action including but not limited to limited, restricted or no access to certain features or services provided by TRADEXIC. If the User proceeds and withdraws consent, TRADEXIC and any third party associated with it shall cease to collect, use or disclose Data, except for the cases when it is required or authorized under law or by Court Order. Please note, in case of withdrawal of consent, TRADEXIC shall continue to retain the Data already collected for a period of five years as per Retention Clause above.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Transfer of Data Outside of Singapore</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">By submitting the Data, the User specifically consents to the transfer, storing or processing of it outside of his/ her jurisdiction for specific purposes such as identity verification, performance, completion, cancellation or reversal of Transaction(s) or providing of TRADEXIC Services. TRADEXIC shall in such events ensure that the standard of protection accorded to the Data in such territory outside Singapore shall be comparable to the protection under the PDPA.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Third Party Links and Data Protection</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">The Platform may provide links to the websites of other third parties. These third-party websites may collect personal information and data about Users on those Websites. It is expressly clarified and the User agrees to have read and understood that TRADEXIC&#39;s Privacy Policy does not extend to these external websites and third parties. It is recommended that the User refer directly to these third parties and web sites regarding their privacy policies before disclosing any personal information or data. Please note that TRADEXIC.io is under no responsibility for the information published on these websites.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Policy Modifications</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">TRADEXIC may modify and amend this Policy from time to time without notifying User&#39;s personally. The amended policy shall be effective as soon as it is published on this page. The Policy shall have the &#39;last updated&#39; date for the convenience of the User to take note of the latest amendments to the Policy. TRADEXIC recommends the User to visit this page on a regular basis. It is the User&#39;s sole responsibility to stay informed about the modifications and amendments.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Complaints and Queries</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:10.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">All complaints and queries relating to this Privacy Policy should be addressed to the Data Protection Officer, appointed in compliance with PDPA. TRADEXIC shall endeavor to resolve all reasonable complaints and queries on a best effort basis within a reasonable time as may be provided under the applicable law.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-bottom:7.5pt; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"line-height:36.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4a4a4a\"><span style=\"letter-spacing:.75pt\">Details of the Data Protection Officer</span></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin-top:0in; margin-right:0in; margin-bottom:12.0pt; margin-left:0in\"><span style=\"font-size:12pt\"><span style=\"line-height:21.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:10.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#535762\">Contact&nbsp;-&nbsp;<a href=\"mailto:compliance@tradexic.net\">compliance@tradexic.net</a></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><strong>Note:</strong><strong>&nbsp;<span style=\"color:#c0392b;\">Avoid any request claiming company person or partner asking for money or account informatins by email, sms or call, we only send and receive account realated requests by our platforms in built support ticket system.</span></strong></p>',1,'2018-05-02 13:44:35','2019-01-06 08:03:20'),(4,'Cookies','cookies','Cookies','Cookies','We use cookies to try and give you a better experience in Trdaexic.','<p>We use cookies to try and give you a better experience in Trdaexic.</p>\r\n\r\n<p>You can learn more about what kind of cookies we use, why, and how from our <a href=\"http://freshdesk.com/privacy/\" target=\"_blank\">Privacy Policy</a><a href=\"https://www.tradexic.io/privacy\">.</a> If you hate cookies, or are just on a diet, you can disable them altogether too. Just note that the Tradexic service is pretty big on some cookies (we love the choco-chip ones), and some portions of Tradexic may not work properly if you disable cookies.</p>\r\n\r\n<p>We&rsquo;ll also assume you agree to the way we use cookies and are ok with it as described in our <a href=\"http://freshdesk.com/privacy/\" target=\"_blank\">Privacy Policy</a><a href=\"https://www.tradexic.io/privacy\">,</a> unless you choose to disable them altogether through your browser.</p>',1,'2018-05-02 13:45:03','2018-12-19 07:37:20'),(5,'Fees','fees','Fees','Fees','Fees','<h3><em><strong>Trading 