		<tr>\r\n			<td>Withdrawal Fees</td>\r\n			<td>2%</td>\r\n			<td>N/A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Minimum Withdrawal</td>\r\n			<td>500 per transaction</td>\r\n			<td>N/A</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Maximum Withdrawal</td>\r\n			<td>70,000 per transaction</td>\r\n			<td>N/A</td>\r\n		</tr>\r\n	</tbody>\r\n</table>',1,'2018-05-02 13:45:22','2019-01-06 08:04:04'),(6,'Security','security','Security','Security','Security of funds and user information is our top priority. Our security team is continually improving our end-to-end security measures, improving auditing processes, and reducing the \'attack surface\' of our infrastructure. Please note that we cannot disclose too many details of the security measures implemented on the platform for security and proprietary reasons.','<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:28px;\"><span style=\"background:white\"><span style=\"line-height:20.3pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#111111\">Security Policies</span></span></b></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Security of funds and user information is our top priority. Our security team is continually improving our end-to-end security measures, improving auditing processes, and reducing the &#39;attack surface&#39; of our infrastructure. Please note that we cannot disclose too many details of the security measures implemented on the platform for security and proprietary reasons.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:28px;\"><span style=\"background:white\"><span style=\"line-height:20.3pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#111111\">User Account Protection</span></span></b></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Some of the security measures highlighted below are in place by default, and others can be activated based on the security level you need. Please visit&nbsp;</span></span></span><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#4995c4\"><a href=\"https://www.tradexic.io/security\" style=\"color:blue; text-decoration:underline\">www.tradexic.io/security</a></span></span></span><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">&nbsp;to check the security status of your account and see recommendations.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Two-factor authentication (2FA)</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Add an extra layer of security to your account and protect sensitive operations such as logging in, generating API keys, and withdrawing. Configure two-factor authentication using Google Authenticator, or OTP Security Key.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Advanced verification tools to monitor the integrity of your account</span></span></u></span></span></span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Login data is saved and analyzed for unusual activity.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Intelligent system detects IP Address changes to prevent session hijacking.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Email notifications report logins and include a link to instantly freeze your account if you suspect malicious activity.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Limit access to your account based on IP address.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Withdrawals protection</span></span></u></span></span></span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Security system monitors withdrawals by IP address and other user behavior patterns, triggering manual admin inspection on withdrawals that appear unusual.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Withdrawal confirmation step that is immune to malicious browser malware.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Define an address whitelist to ensure no withdrawals can go anywhere else.</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><strong><span style=\"font-size:28px;\"><span style=\"background:white\"><span style=\"line-height:20.3pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#111111\">Cryptocurrency Storage</span></span></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">The overwhelming majority of system funds are stored in offline, cold wallets. Only approximately 0.5% of crypto assets are accessible in hot wallets for day-to-day platform operations. As an added protection, the cold wallets are not available from the platform or the platform servers. The funds in offline cold storage require manual intervention by several members of our management to access.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><strong><span style=\"font-size:28px;\"><span style=\"background:white\"><span style=\"line-height:20.3pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#111111\">System Security</span></span></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Always up-to-date Linux systems to host the platform</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Our server&rsquo;s network is protected using always up-to-date software and the best possible practices.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Automatic backup of the database once a day</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Once a day, the database of the platform is backed up, encrypted and compressed as an archive.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Duplication of backup data automatically</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">As soon as a new backup is ready (database, log files,), it is sent to others servers in several physical locations.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Protection from DDoS attacks</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">We are protected by automatic Distributed Denial of Service protection to ensure that trading cannot be halted by outside attacks.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><strong><span style=\"font-size:20px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><u><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#5a6267\">Securing your Tradexic.io account - Tips &amp; Best Practices</span></span></u></span></span></span></span></strong></p>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Keeping your Tradexic.io account and funds safe is always our&nbsp;top most priority. You form an important part of the effort and together we can keep Tradexic.io as the most secure exchange. Below are some important best practices you should follow to keep your Tradexic.io account secure.</span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0in 0in 8pt; margin-right:0in; margin-left:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;</span></span></span></span><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"orphans:2\"><span style=\"widows:2\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"word-spacing:0px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Using the right Tradexic.io&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">If you are trading via the website, ensure the domain is Tradexic.io</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">When you receive emails from Tradexic.io, check if the email ID is @tradexic.io</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; text-align:start; -webkit-text-stroke-width:0px; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"orphans:2\"><span style=\"widows:2\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"word-spacing:0px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Password</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Always Set a strong password for your account</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Passwords must be atleast 6 characters long and a maximum of 64 characters.&nbsp;We recommend using passwords longer than 10 characters.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Include a combination of characters, numbers and symbols like $%^~ in your password</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never use common words as passwords. For eg your name or birthdate or your pet&#39;s name</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never use a password that you have used elsewhere. For eg - your email password, your facebook password or even your password for another cryptocurrency exchange</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never share your password with anyone else. Tradexic.io&nbsp;will never call or email you asking for your password. Nobody needs your password to help you with a problem.</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-right:0in; margin-left:0in\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">You should also follow the above tips to secure the email ID that you have registered with your Tradexic.io account.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">OTP</span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never share your OTP with anyone else. Even if someone claims they&#39;re contacting your from Tradexic.io. We never need your OTP to help you with any problem.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">If you have received an OTP on your phone without requesting for one, please contact our support team immediately.&nbsp;&nbsp;</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Account Details</span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never share account details like your&nbsp;<strong style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\">registered </span></strong><b>Tradexic.io<strong><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"> email ID, mobile number, bank details, and Transaction number</span></strong></b>&nbsp;<strong style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\">or amount</span></strong>&nbsp;publicly. Only share it with the support team if asked through official <strong>Support Ticket System within your Tradexic.io accoun</strong>t. </span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Devices</span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Keep your phone OS updated to the latest version. Your OS makes regular security updates so it&#39;s important that you stay updated with the latest fixes.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Setup fingerprint recognition, passcode or any other access security features that you phone may support</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">If possible, enable features that wipe out your phone in case it is lost.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Avoid jailbreaking your phone as that may compromise the phone&#39;s security updates.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Install a good antivirus software on your computer but don&#39;t depend entirely on it.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Avoid installing too many softwares or browser extensions.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Do not download or install files you don&#39;t trust. Especially if they download automatically or are sent as an email attachment</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Only connect to WIFI &amp; Internet networks that you are familiar with and fully trust. Keep your home WIFI networks password protected</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; text-align:start; -webkit-text-stroke-width:0px; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"orphans:2\"><span style=\"widows:2\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"word-spacing:0px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Crypto Deposits &amp; Withdrawals</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Always cross check the deposit address that you have copied when you paste it into the withdrawal wallet.&nbsp;</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; text-align:start; -webkit-text-stroke-width:0px; margin-right:0in; margin-left:0in\"><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"orphans:2\"><span style=\"widows:2\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"word-spacing:0px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">General Advice</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Avoid operating your Tradexic.io account on public computers like cyber cafes</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Always log out of your Tradexic.io account if someone else uses the same device</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Avoid sharing details of your investments in public channels like telegram, whatsapp, forums etc. Don&#39;t disclose your cryptocurrency holdings to anyone in public.</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Never send money to anyone claiming to be representing Tradexic.io. We will never ask you to send money to random addresses or accounts</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Setup 2FA for the email ID that you use for trading. For eg - Gmail, Outlook etc</span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h2 style=\"margin-top:0in; margin-right:0in; margin-left:0in\"><strong><span style=\"font-size:18pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-weight:bold\"><span style=\"font-size:16.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><span style=\"font-weight:normal\">Official TradeXic Accounts/Links</span></span></span></span></span></span></span></span></span></strong></h2>\r\n\r\n<p style=\"margin-right:0in; margin-left:0in\"><strong><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"box-sizing:border-box\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">The following are official Tradexic.io accounts on social media and other platforms. We advise you to please not interact with any other accounts.</span></span></span></span></span></span></span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Website -</strong>&nbsp;<a href=\"https://www.tradexic.io/\" target=\"_blank\">Tradexic.io</a> </span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><strong><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">Email - </span></span></span></span></span></span></span></span></strong><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\">@tradexic.net</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Telegram Announcement Channel - (Tradexic)</strong> <a href=\"https://t.me/tradexic/\" target=\"_blank\">https://t.me/tradexic</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Telegram Discussion Group &ndash; (Tradexic Talk)</strong> <a href=\"https://t.me/tradexictalk/\" target=\"_blank\">https://t.me/tradexictalk</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Twitter -</strong>&nbsp;<strong>(@tradexic)</strong>&nbsp;<a href=\"https://twitter.com/tradexic/\" target=\"_blank\">https://twitter.com/tradexic</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Facebook -</strong>&nbsp;<a href=\"https://www.facebook.com/tradexic/\" target=\"_blank\">https://www.facebook.com/tradexic</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Blog - Tradexic Blog</strong>&nbsp;<a href=\"https://blog.tradexic.net/\" target=\"_blank\">https://blog.tradexic.net/</a> </span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Instagram -&nbsp;(@tradexic)</strong>&nbsp;<a href=\"https://www.instagram.com/tradexic/\" target=\"_blank\">https://www.instagram.com/tradexic/</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Bitcoin Talk - Tradexic</strong>&nbsp;<a href=\"https://bitcointalk.org/index.php?topic=5093622\">https://bitcointalk.org/index.php?topic=5093622</a>&nbsp;</span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Tradexic Help/Support -</strong> <a href=\"https://tradexic.freshdesk.com/\" target=\"_blank\">https://tradexic.freshdesk.com</a></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0in 0in 8pt; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:11.5pt\"><span style=\"font-family:&quot;Segoe UI&quot;,sans-serif\"><span style=\"color:#1c1b21\"><strong>Tradexic Beta Community -</strong> <a href=\"https://bit.ly/tradexic\" target=\"_blank\">https://bit.ly/tradexic</a> </span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin:0in 0in 8pt\"><span style=\"color:#000000;\"><strong>Note:</strong></span><span style=\"color:#c0392b;\"><strong>&nbsp;Avoid any request claiming company person or partner asking for money or account informatins by email, sms or call, we only send and receive account realated requests by our platforms in built support ticket system.</strong></span></p>\r\n',1,'2018-05-02 13:45:41','2019-01-10 16:27:13'),(7,'Supported Currency','supported-currency','Supported Currency','Supported Currency','Supported Currency','<div class=\"about-main-s\">\r\n<div class=\"col-md-12\">\r\n<div class=\"abt-top\">\r\n<p align=\"left\"><em><strong>Supported Currencies</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p align=\"left\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/6/content_bitcoin-logo-square.png\" style=\"width: 131px; height: 131px;\" /></p>\r\n\r\n<p align=\"left\">Bitcoin is a cryptocurrency, a form of electronic cash. It is a decentralized digital currency without a central bank or single administrator that can be sent from user to user on the peer-to-peer bitcoin network without the need for intermediaries.&nbsp;<a data-ved=\"2ahUKEwix4YqYrbndAhWrrFkKHbWKC5UQmhMwG3oECAYQIA\" href=\"https://en.wikipedia.org/wiki/Bitcoin\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://en.wikipedia.org/wiki/Bitcoin&amp;ved=2ahUKEwix4YqYrbndAhWrrFkKHbWKC5UQmhMwG3oECAYQIA\">Wikipedia</a></p>\r\n\r\n<p align=\"left\">Initial release:&nbsp;0.1.0 / 9 January 2009 (9 years ago)</p>\r\n\r\n<p align=\"left\">Ledger start:&nbsp;3 January 2009 (9 years ago)</p>\r\n\r\n<p align=\"left\">Coins:&nbsp;Unspent outputs of transactions (in multiples of a satoshi)</p>\r\n\r\n<p align=\"left\">Supply limit:&nbsp;21,000,000</p>\r\n\r\n<p align=\"left\">Founder:&nbsp;Satoshi Nakamoto</p>\r\n\r\n<p align=\"left\">Programming language:&nbsp;C++</p>\r\n\r\n<p align=\"left\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/9/content_litecoin-logo-sqare.png\" style=\"width: 145px; height: 145px;\" /></p>\r\n\r\n<p align=\"left\">Litecoin is a peer-to-peer cryptocurrency and open source software project released under the MIT/X11 license. Creation and transfer of coins is based on an open source cryptographic protocol and is not managed by any central authority. Litecoin was an early bitcoin spinoff or altcoin, starting in October 2011.&nbsp;<a data-ved=\"2ahUKEwixj-aBrrndAhVvx1kKHfeQCsEQmhMwJnoECAcQIA\" href=\"https://en.wikipedia.org/wiki/Litecoin\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://en.wikipedia.org/wiki/Litecoin&amp;ved=2ahUKEwixj-aBrrndAhVvx1kKHfeQCsEQmhMwJnoECAcQIA\">Wikipedia</a></p>\r\n\r\n<p align=\"left\">Original author(s):&nbsp;Charlie Lee</p>\r\n\r\n<p align=\"left\">Initial release:&nbsp;0.1.0 / 7 October 2011; 6 years ago</p>\r\n\r\n<p align=\"left\">Forked from:&nbsp;Bitcoin</p>\r\n\r\n<p align=\"left\">Supply limit:&nbsp;84,000,000 LTC</p>\r\n\r\n<p align=\"left\">Symbol:&nbsp;</p>\r\n\r\n<p align=\"left\">Circulating supply:&nbsp;56,851,198 LTC (6 June 2018)</p>\r\n\r\n<p align=\"left\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/7/content_ethereum-logo-square.png\" style=\"width: 116px; height: 116px;\" /></p>\r\n\r\n<p align=\"left\">Ethereum is an open-source, public, blockchain-based distributed computing platform and operating system featuring smart contract functionality. It supports a modified version of Nakamoto consensus via transaction-based state transitions.&nbsp;<a data-ved=\"2ahUKEwj9otyorrndAhXLo1kKHX0ODwkQmhMwJHoECAgQIQ\" href=\"https://en.wikipedia.org/wiki/Ethereum\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://en.wikipedia.org/wiki/Ethereum&amp;ved=2ahUKEwj9otyorrndAhXLo1kKHX0ODwkQmhMwJHoECAgQIQ\">Wikipedia</a></p>\r\n\r\n<p align=\"left\">Initial release date:&nbsp;July 30, 2015</p>\r\n\r\n<p align=\"left\">Written in:&nbsp;Go,&nbsp;C++,&nbsp;Rust,&nbsp;Solidity</p>\r\n\r\n<p align=\"left\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/10/content_bitcoin-cash-logo_1-144.png\" style=\"width: 144px; height: 144px;\" /></p>\r\n\r\n<p align=\"left\">Bitcoin Cash is a cryptocurrency. In mid-2017, a group of developers wanting to increase bitcoin&#39;s block size limit prepared a code change. The change, called a hard fork, took effect on 1 August 2017. As a result, the bitcoin ledger called the blockchain and the cryptocurrency split in two.<a data-ved=\"2ahUKEwihsefKrrndAhWEuVkKHW-ACpoQmhMwHHoECAgQIA\" href=\"https://en.wikipedia.org/wiki/Bitcoin_Cash\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://en.wikipedia.org/wiki/Bitcoin_Cash&amp;ved=2ahUKEwihsefKrrndAhWEuVkKHW-ACpoQmhMwHHoECAgQIA\">Wikipedia</a></p>\r\n\r\n<p align=\"left\">First block after split (block #478559):&nbsp;1 August 2017 (12 months ago)</p>\r\n\r\n<p align=\"left\">Block #1:&nbsp;9 January 2009 (9 years ago)</p>\r\n\r\n<p align=\"left\">Block reward:&nbsp;12.5 BCH</p>\r\n\r\n<p align=\"left\">Genesis block:&nbsp;3 January 2009 (9 years ago)</p>\r\n\r\n<p align=\"left\">Coins:&nbsp;Unspent outputs of transactions</p>\r\n\r\n<p align=\"left\">Supply limit:&nbsp;21,000,000 BCH</p>\r\n\r\n<p align=\"left\">Hash function:&nbsp;SHA-256</p>\r\n\r\n<p align=\"left\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/11/content_ripple-11-645998-144.png\" style=\"width: 144px; height: 144px;\" /></p>\r\n\r\n<p align=\"left\">Ripple is a real-time gross settlement system, currency exchange and remittance network created by Ripple Labs Inc., a US based technology company. Also called the XRP Ledger, Ripple is built upon a distributed open source internet protocol, consensus ledger and the decentralized native cryptocurrency known as XRP.&nbsp;<a data-ved=\"2ahUKEwiE8PPprrndAhWsxFkKHVQGAlIQmhMwKnoECAcQJA\" href=\"https://en.wikipedia.org/wiki/Ripple_(payment_protocol)\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://en.wikipedia.org/wiki/Ripple_(payment_protocol)&amp;ved=2ahUKEwiE8PPprrndAhWsxFkKHVQGAlIQmhMwKnoECAcQJA\">Wikipedia</a></p>\r\n\r\n<p align=\"left\">Original author(s):&nbsp;Arthur Britto, David Schwartz,&nbsp;Ryan Fugger</p>\r\n\r\n<p align=\"left\">Initial release:&nbsp;2012</p>\r\n\r\n<p align=\"left\">Founder:&nbsp;Chris Larsen</p>\r\n\r\n<p align=\"left\">Stable release:&nbsp;1.0.0 / 15 May 2018</p>\r\n\r\n<p align=\"left\">Developed by:&nbsp;Ripple</p>\r\n\r\n<p align=\"left\">Operating system:&nbsp;Server:&nbsp;GNU/Linux&nbsp;(RHEL,&nbsp;CentOS,&nbsp;Ubuntu), Windows,&nbsp;macOS&nbsp;(development only)</p>\r\n</div>\r\n</div>\r\n</div>',1,'2018-05-02 13:46:16','2019-01-06 08:02:59'),(8,'API','how-it-works','api','api','Tradexic.io provides a simple and powerful REST API to allow you to nearly perform all actions you can from our web interface. We provide a simple RESTful API.','<h3 style=\"text-align: center;\"><em><u><strong>APIs</strong></u></em></h3>\r\n\r\n<h3><em><strong>API Reference</strong></em></h3>\r\n\r\n<p>Our APIs are broken into distinct groups</p>\r\n\r\n<ul>\r\n	<li>Public - Public information available without an API key</li>\r\n	<li>Market - For programatic trading of crypto currencies</li>\r\n	<li>Account - For managing your account</li>\r\n</ul>\r\n<script src=\"https://wchat.freshchat.com/js/widget.js\"></script><script>\r\n  window.fcWidget.init({\r\n    token: \"010b2696-5c0b-49be-a631-a9e535556fde\",\r\n    host: \"https://wchat.freshchat.com\"\r\n  });\r\n</script>',0,'2018-05-02 13:46:44','2018-11-27 12:47:01'),(9,'FAQ','faq','FAQ ','FAQ, help','FAQ','<div class=\"col-sm-12\">\r\n<div class=\"faq_accordian_pg\">\r\n<h2>Trading</h2>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse1\">What is Tradexic?</h4>\r\n\r\n<p>Tradexic is a Robust Crypto Exchange and Trading Platform . Equipped with Institutional Grade Matching Engine with most secure wallets. All Under one Dash Board , Enabling a Seamless Trading Experience.</p>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse2\">How to do Fiat&nbsp;Trading, Deposits and Withdrawals?</h4>\r\n\r\n<p>Tradexic supports eligible personal and corporate accounts for INR trading, INR deposits, and INR withdrawals. Identity verified (personal or corporate) are eligible to participate.</p>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse3\">How do I perform a trade?</h4>\r\n\r\n<p>This video shows you how to deposit and buy coins https://www.youtube.com/</p>\r\n\r\n<p>For quick trades, you can also use the Buy &amp; Sell butuns under&nbsp;buy or sell orders.</p>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse4\">What are my trade limits?</h4>\r\n\r\n<p>Minimum Trade Size: &nbsp;The minimum trade value for orders is 100,000 Satoshis (.00100000). &nbsp;There is also a minimum trade quantity. &nbsp;For example, DOGE trades at 22 satoshis. &nbsp;The minimum trade quantity is 4500 DOGE and the minimum trade value is 100,000 Satoshis. &nbsp;The smallest order in the book is 100000 DOGE at 1 satoshi each. &nbsp;The largest order in the book is 4500 DOGE at 2 btc each.&nbsp;</p>\r\n\r\n<p>Creating minimum tick sizes: The following minimum tick size changes are pending review and customer feedback.</p>\r\n\r\n<p>On a per market basis, we will be instituting minimum tick sizes that are based on the current price of the market. &nbsp;The target is to have minimum trade sizes that are near 0.25% of the current price. &nbsp;The current minimum tick size is 1 satoshi. &nbsp;For example, Ethereum trades at 0.0577 Bitcoin. &nbsp;Bids and asks can only be placed in 0.0001 increments. &nbsp;So the next level on the bid side of the orderbook will be 0.0576 and 0.0578 on the ask.</p>\r\n\r\n<p>A general statement about market manipulation tactics: &nbsp;Tradexic actively discourages any type of market manipulation, including pump groups. Consistent with our terms of service, we will suspend and close any accounts engaging in this type of activity and notify the appropriate authorities.</p>\r\n\r\n<h2>Accounts</h2>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse5\">What fees does Tradexic charge?</h4>\r\n\r\n<p>Trades - All trades are charged 0.25%.</p>\r\n\r\n<p>Deposits - There are no fees for deposits. &nbsp;Please be aware that some coins require us to move your funds to another address before we credit them. &nbsp;This means the coins network will charge you the normal transaction fee for this send. &nbsp;This is not something we can avoid.</p>\r\n\r\n<p>Withdraws - Our intention is to not make any profits on withdraws. &nbsp;However, each coin has a network transfer fee that is built into the coin. This means that we must charge a small amount to cover this fee. You can view all the fee at this link: http://www.tradexic.io/fees.</p>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse6\">What is the 2-factor authentication?</h4>\r\n\r\n<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<h4 data-parent=\"#accordion\" data-toggle=\"collapse\" href=\"#collapse7\">How do I delete my account?</h4>\r\n\r\n<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n</div>\r\n</div>',1,'2018-05-02 13:47:09','2019-01-06 08:05:15'),(10,'Add Coin','add-coin','Add Coin','Add Coin, add token, ','Add Coin','<h2><em><strong>Coin/Token Listing Policy</strong></em></h2>\r\n\r\n<hr />\r\n<p><br />\r\nTo be listed on Tradexic.io&nbsp;coin should fallow given&nbsp;requirements<br />\r\n<br />\r\n1. t least 2 social media pages with informatible messagess.<br />\r\n2. Trading volume should be at least 0.2 BTC in a month.</p>\r\n\r\n<hr />\r\n<p><br />\r\nCoin can be delisted if:<br />\r\n* Has few trades during a 2 week period<br />\r\n* Consumes a lot of server resources and can&#39;t be fixed<br />\r\n* Unstable wallet or unstable blockchain (multiple chains / stopped blocks)<br />\r\n* Coins which turn out to be scams will be delisted instantly</p>\r\n\r\n<hr />\r\n<p><br />\r\nTo list your altcoin please contact us at <a href=\"mailto:listing@tradexic.net\">listing@tradexic.net</a><br />\r\n<br />\r\nOur team will check your request and contact you within 48 hours to discuss your listing poocess.</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<h2><em><strong>Coin/Token&nbsp;Delisting Policy</strong></em></h2>\r\n\r\n<hr />\r\n<p><br />\r\n1) In accordance with the Tradexic.io Listing policy, Tradexic.i officials expect to be informed by developers of cryptocurrencies about any amendments such as updates, forks &amp; changes applied in their blockchain.</p>\r\n\r\n<p>2) Tradexic.io weekly reviews all cryptocurrencies on the Exchange to ensure all of them are consistent with the Tradexic.io listing policy.</p>\r\n\r\n<p>3) Tradexic.io reserves the right to remove any cryptocurrency or market from its Exchange for any of the following reasons:</p>\r\n\r\n<ul>\r\n	<li>Violation of the terms of the Tradexic.io Listing Policy, including insufficient trading volume on the exchange;</li>\r\n	<li>Blockchain becomes defective, resulting in not receiving funds withdrawn by users from Tradexic.io;</li>\r\n	<li>Cryptocurrency/Token is no longer supported by its developers;</li>\r\n	<li>Developers are late or cease notifying about any amendments such as updates, forks, changing of the explorer address, etc, made and applied in their blockchain;</li>\r\n	<li>Developers fail to provide links for updates before any of the amendments are applied;</li>\r\n	<li>Poor implementation of a cryptocurrency/Token blockchain software, resulting in failures to receive funds by users and consequently demands frequent updates (more than 2 during 30 days period);</li>\r\n	<li>A Cryptocurrency/Token site, topics, and other cryptocurrency information resources do not provide the link to Tradexic.io.</li>\r\n</ul>\r\n\r\n<p>4) Upon detecting one of the reasons for delisting a cryptocurrency/token, Tradexic.io shall notify all users via the notification system on the trade page and the market page.</p>\r\n\r\n<p>5) If a cryptocurrency/token is marked for delisting, it will be delisted in 7 days. Under extraordinary circumstances Tradexic.io reserves the right, in its sole discretion, to immediately delist a cryptocurrency/token.</p>\r\n\r\n<p>6) After the notification, users, who own the named cryptocurrencies/tokens, ought to withdraw them before the posted withdrawal deadline.</p>\r\n\r\n<p>DISCLAIMER: Tradexic.io is not liable to any users&rsquo; losses sustained in case of circumstances under which a user for any reason is late to withdraw the funds before the deadline or fails to withdraw the funds due to events outside of Tradexic.io&rsquo;s control (such as broken blockchain, unavailable nodes, etc.).</p>\r\n',1,'2018-07-27 20:26:43','2019-01-06 08:07:04'),(11,'Partnership','partnership','partnership','partnership, P2P, exchange, bitcoin exchange, crypto exchange,  ','Individuals, Institutions and intermediaries who seek a partner to be part of our P2P transaction service as part of their growth strategy work with TRADEXIC.IO to implement peer-to-peer transaction services.','<p style=\"margin-top:6.0pt; margin-right:0in; margin-bottom:6.0pt; margin-left:0in; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;var(--gentium-basic)&quot;,serif\"><span style=\"color:#222222\">We work with many P2P payment partners, who provide peer-to-peer transaction services for our users. </span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-top:6.0pt; margin-right:0in; margin-bottom:6.0pt; margin-left:0in; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;var(--gentium-basic)&quot;,serif\"><span style=\"color:#222222\">Individuals, Institutions and intermediaries a</span></span></span></span></span></span></span><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;var(--gentium-basic)&quot;,serif\"><span style=\"color:#222222\">nyone can be part of this P2P service. By identifying what type of partnership is most suitable for you, we can tell you more about the benefits available, and the resources that can help you get started. There are no membership or partnership costs involved in collaborating with us.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-top:6.0pt; margin-right:0in; margin-bottom:6.0pt; margin-left:0in; margin:0in 0in 8pt\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.5pt\"><span style=\"font-family:&quot;var(--gentium-basic)&quot;,serif\"><span style=\"color:#222222\">Email us at <a href=\"mailto:partner@tradexic.net?subject=Partner%20&amp;body=Hi%20i%20would%20like%20to%20get%20the%20information%20regarding%20P2P%20Partnership%20with%20Tradexic.io%20platform.%0A%0AMy%20Name%3A%0AMy%20Location%3A%0AMy%20Contact%20Number%3A\">partner@tradexic.net</a></span></span></span></span></span></span></span></p>\r\n',1,'2018-12-17 22:51:24','2018-12-27 07:55:49');
